webpackJsonp([0x67a0b68baf0d],{407:function(e,t){e.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 149.9%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/sanfran-e351b90ca34df930d3b39496364423fe-631b1.jpg"\n        srcset="/static/sanfran-e351b90ca34df930d3b39496364423fe-30fbd.jpg 200w,\n/static/sanfran-e351b90ca34df930d3b39496364423fe-e87dc.jpg 400w,\n/static/sanfran-e351b90ca34df930d3b39496364423fe-631b1.jpg 800w,\n/static/sanfran-e351b90ca34df930d3b39496364423fe-ab477.jpg 1000w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<p>It’s been about a year since I fell in love with coding. Since then I’ve built numerous <a href="https://github.com/twmilli?tab=repositories">projects</a>, completed over 1000 hours worth of coursework on <a href="https://www.freecodecamp.com/">Free Code Camp</a>, and accepted my first internship working at <a href="https://www.braintreepayments.com/">Braintree</a> in San Francisco.</p>\n<p>Although many people have achieved similar successes without too much effort, I think it’s important to note that I’m currently majoring in chemical engineering at Bucknell, a school consistently ranked outside the top 50 programs for computer science.</p>\n<p>A little over a year ago, I walked into my first tech interview. The recruiter was from Microsoft, and he was holding an open on-campus interview session. I remember sitting down for the interview, completely naive to the type of questions he would ask me.</p>\n<p>After a quick introduction, he asked me, “How would you reverse a linked-list?”</p>\n<p>I paused in an attempt to contain my nervousness, before giving him my vague and clearly fabricated answer. A few minutes later the recruiter thanked me for my time.</p>\n<p>I left feeling simultaneously embarrassed for having wasting his time, yet exhilarated by what I’d just experienced.</p>\n<p>I couldn’t believe it. They actually cared about my technical ability to code!</p>\n<p>It was so refreshing that companies were able to look at something other than my GPA, which school I went to, and my ability to talk your way through behavioral questions. The companies I interviewed with didn’t seem to care that that I was majoring in chemical engineering. They just wanted to see whether I could code.</p>\n<p>From there I got to work. I sent out nearly 100 applications over the next month. I was willing to take any opportunity available.\nAs of January, I had received nothing but generic rejection emails. Not a single interview!</p>\n<p>But I couldn’t really blame them. I was a chemical engineering major and my only relevant experience was taking two introductory computer science courses. So I decided my best option was to accept a summer research position in my school’s chemical engineering department.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.625%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/1-20152a612c5c6d66c9b0d4f628cc5735-631b1.jpg"\n        srcset="/static/1-20152a612c5c6d66c9b0d4f628cc5735-30fbd.jpg 200w,\n/static/1-20152a612c5c6d66c9b0d4f628cc5735-e87dc.jpg 400w,\n/static/1-20152a612c5c6d66c9b0d4f628cc5735-631b1.jpg 800w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>photo by <a href="https://unsplash.com/@iamkiran">Sai Kiran Anagani</a></h4>\n<p>On the outside, it felt like I was giving up. But in actuality, I was doubling down on my new found passion for programming. In my head, I vowed that next year would be different.</p>\n<p>Over winter break, I worked my way through an Android programming course on <a href="https://www.udemy.com/">Udemy</a>. I started devoting way more time to my Computer Science courses. Once summer break hit, I was off to the races.</p>\n<h2>Putting in the work</h2>\n<p>I knew from the year prior that I would need to build some projects on my own in order to get an interview. I also knew that I would need to get good at coding and algorithms questions so I could pass my technical interviews.</p>\n<p>I used a simple but effective pattern to improve the areas where I was lacking:</p>\n<ol>\n<li>Set a goal related to what you want to learn.</li>\n<li>Find the best learning resources available (within your budget) for this subject.</li>\n<li>Set a consistent schedule to make use of these resources.</li>\n<li>Profit.</li>\n</ol>\n<p>A real example of this for me during the past summer looks like:</p>\n<ol>\n<li>Build a quality portfolio of web apps</li>\n<li>Free Code Camp is free and pretty awesome</li>\n<li>Code every day, either in the morning or after dinner</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 613px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 118.92332789559543%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/2-133eeee2c7809f6a2da1734d81423708-345d4.png"\n        srcset="/static/2-133eeee2c7809f6a2da1734d81423708-e020e.png 200w,\n/static/2-133eeee2c7809f6a2da1734d81423708-da3fb.png 400w,\n/static/2-133eeee2c7809f6a2da1734d81423708-345d4.png 613w"\n        sizes="(max-width: 613px) 100vw, 613px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>One of my earlier projects, a <a href="http://twmilli.github.io/pomodoro/">pomodoro clock</a></h4>\n<p>I applied a similar practice to improving my technical interviewing skills using <a href="https://www.amazon.com/Cracking-Coding-Interview-Programming-Questions/dp/0984782850/ref=sr_1_1?ie=UTF8&#x26;qid=1481228995&#x26;sr=8-1&#x26;keywords=cracking+the+coding+interview">Cracking The Coding Interview</a>, <a href="https://www.pramp.com/">Pramp.com</a>, and <a href="https://leetcode.com/">Leetcode.com</a>.</p>\n<h2>Coding Every Day</h2>\n<p>During the summer, I made a point to write code nearly everyday. Most days I would wake up thinking about my current project, excited about the features I would be working on. But there were definitely some exceptions.</p>\n<blockquote>\n<p>“Amateurs sit and wait for inspiration, the rest of us just get up and go to work.”\n― Stephen King</p>\n</blockquote>\n<p>On these days I would usually force myself to code for at least 30 minutes. Most of the time after the 30 minutes I was immersed and happy to continue. But if not, I gave myself complete permission to stop and move away from the computer for the rest of the night.</p>\n<p>I also made a point to spend every Saturday or Sunday off campus in nature with friends. As Cal Newport talks about in <a href="https://www.amazon.com/Deep-Work-Focused-Success-Distracted/dp/1455586692">Deep Work</a>, spending time in nature away from technology has been shown to have rejuvenating effects.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/3-5eae7aac005fd2c488bc160370dcfec7-631b1.jpg"\n        srcset="/static/3-5eae7aac005fd2c488bc160370dcfec7-30fbd.jpg 200w,\n/static/3-5eae7aac005fd2c488bc160370dcfec7-e87dc.jpg 400w,\n/static/3-5eae7aac005fd2c488bc160370dcfec7-631b1.jpg 800w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>The article didn’t seem complete without a sweaty picture of me doing a headstand in the alps</h4>\n<p>It’s also worth noting that I took two weeks off from work and coding in the middle of the summer to take a family vacation hiking in the alps.</p>\n<p>From the end of May until now, I’ve pushed code to my <a href="https://github.com/twmilli">GitHub</a> more than 250 times.</p>\n<h2>The Hunt</h2>\n<p>By the end of the summer, I had built 21 new front-end websites to show off. I knew I had a shot at getting an internship. But with chemical engineering at the top of my resume, I was scared I wouldn’t be given a chance.</p>\n<p>I brushed up my resume to show off my new projects and got feedback on <a href="https://www.reddit.com/r/cscareerquestions/">/r/cscareerquestions</a>. I made a <a href="https://docs.google.com/spreadsheets/d/15BjTUNgeKBznDpKjsvMWYfs1FkivRM0H2uZkaE7cICs/edit?usp=sharing">spreadsheet</a> to keep track of where I had applied, and my application status.</p>\n<p>On August 20th I giddily sent out my first application to <a href="http://www.belvederetrading.com/">Belvedere Trading</a>. It seemed laughably early, but I was not about to make the mistake of applying too late like I did the year prior.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 86.75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/4-a45c47c6d46c91c064f8ba2b34ce210a-ea913.png"\n        srcset="/static/4-a45c47c6d46c91c064f8ba2b34ce210a-086ab.png 200w,\n/static/4-a45c47c6d46c91c064f8ba2b34ce210a-b16c6.png 400w,\n/static/4-a45c47c6d46c91c064f8ba2b34ce210a-ea913.png 800w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>An entertaining “zombie shooter” game I built with a few friends</h4>\n<p>A week later they sent me a coding challenge. I aced it.</p>\n<p>We scheduled a phone interview a few days later.</p>\n<p>The day after that, I booked a flight to Chicago for my first ever on-site interview.</p>\n<p>I slept less than 4 hours the night before the interview — both out of anticipation, and fear of missing my 8 a.m. flight.</p>\n<p>When I made it to the office for the start of the interview, I met a handful of other students who were interviewing the same day. I scanned their name tags: Carnegie Melon, Cornell, and UMichigan. Did I really belong here?</p>\n<p>The next afternoon I got an incoming call from Chicago. They wanted to make an offer.</p>\n<p>For the second night in a row, I could barely sleep — this time out of excitement. Just a few weeks prior, I had been nervous that I wouldn’t be able to find anywhere to intern. And now it was only mid-September, and I already had an offer.</p>\n<p>But I wasn’t done yet. I had recently read <a href="https://medium.com/@hosseeb">Haseeb Qureshi’s</a> article on <a href="https://medium.freecodecamp.com/how-not-to-bomb-your-offer-negotiation-c46bb9bc7dea#.qtddaiju5">salary negotiation</a> and I decided to take his advice. I cold-emailed a few of my “dream” companies and let them know that I had just received an offer, but that I would rather work for them.</p>\n<p>A few days later, a recruiter at Braintree responded to my message. A similar process ensued: coding challenge -> phone interview -> another trip to Chicago.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 740px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.62162162162161%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title=""\n        src="/static/5-141bce588049334ebbe0571dde09b6da-c89c6.png"\n        srcset="/static/5-141bce588049334ebbe0571dde09b6da-fbf4e.png 200w,\n/static/5-141bce588049334ebbe0571dde09b6da-837da.png 400w,\n/static/5-141bce588049334ebbe0571dde09b6da-c89c6.png 740w"\n        sizes="(max-width: 740px) 100vw, 740px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>It didn’t hurt that the office was pretty sweet…</h4>\n<p>In my taxi from the office back to the airport, I got another call. They wanted to extend an offer. I accepted shortly after, and negotiated to work at their office in San Francisco.</p>\n<h2>Lessons learned along the way</h2>\n<h3>Lesson #1: I didn’t get the internship because I’m a genius, or a naturally gifted programmer. I got it because I put in the time and hard work.</h3>\n<p>A non-chemical engineering major who was passionate about chemistry could have gone through a similar process to my coding regiment and become a better chemical engineer than I will ever be.</p>\n<p>If you start focusing on things you enjoy, you’ll have a huge advantage over everyone else.</p>\n<h3>Lesson #2: Don’t be afraid to set goals that seem out of reach.</h3>\n<p>Bold goals are exciting. The rush you get when taking action to reach your goal will far outweigh the downside that you might not reach it.\nEven if you fall short, you will get further than you would have otherwise.</p>\n<h3>Lesson #3: Try something new.</h3>\n<p>I had no idea that I would fall in love with programming a year ago.</p>\n<p>Be willing to take a chance and try something out of your comfort zone, you just might find something you love.</p>\n<p>Some resources I’ve found helpful</p>\n<ul>\n<li><a href="https://softwareengineeringdaily.com/">Software Engineering Daily</a> — My favorite podcast for keeping up with new trends and topics in software.</li>\n<li><a href="https://www.amazon.com/Choose-Yourself-James-Altucher/dp/1490313370">Choose Yourself</a> by James Altucher</li>\n<li><a href="https://www.amazon.com/Deep-Work-Focused-Success-Distracted/dp/1455586692">Deep Work</a> by Cal Newport</li>\n<li><a href="http://haseebq.com/how-to-break-into-tech-job-hunting-and-interviews/">How to Break Into the Tech Industry</a> by Haseeb Qureshi</li>\n<li><a href="https://www.youtube.com/watch?v=8KuO4r5CHjM&#x26;list=PLcSNwoY_zA3b9McOf2rDRinpzyt2hlHzC">CS75 Harvard Lectures</a> — an introduction to how the internet works and scalability issues (especially useful for systems design interview questions).</li>\n</ul>\n<p>A massive thank you to all of the people who helped me along the way, and to you for taking the time out of your day to read my article.</p>\n<p>P.S: If you know of any cheap housing in San Francisco this summer or will be in the area and want to meet up, <a href="mailto:twm013@bucknell.edu">email me</a>.</p>',frontmatter:{path:"/how-i-landed-a-top-tier-internship",title:"How I landed a top-tier tech internship by doing something I love",date:"12-10-2016",tag:"Career"}}},pathContext:{}}}});
